INSERT INTO `faq` (`Id`, `pregunta`, `respuesta`, `orden`) VALUES
(1, 'Hay monto mnimo de compra?', 'El monto mnimo de compra es una caja.', 1),
(2, 'Cuales son las formas de pago?', 'Se paga en efectivo a contra entrega.', 2),
(3, 'Tiene costo el envo de pedidos a CABA?', 'No! El envo es sin costo.', 3),
(5, 'Si soy del interior del pas, me envan los productos?', 'Contactate a nuestro correo, info@muecasproductos.com.', 5),
(6, 'Cmo son los pasos para realizar mi primer compra?', 'Registrate a la pgina, y segu los pasos.', 6),
(7, 'Puedo hacer un reclamo sobre mi pedido?', 'Por supuesto! Escribinos al mail info@muecasproductos.com. ', 7),
(8, 'Si no estoy disponible cuando llega la mercadera, Puede recibir el pedido otra persona?', 'Si! En la seccin "Mi cuenta", ingres al pedido y nos pods avisar en nuestro chat de pedidos.', 8),
(9, 'Puede una caja venir de dos sabores?', 'No, las cajas pueden ser surtidas (7 de cada sabor), o enteras de uno.', 9),
(10, 'Cmo me registro?', 'Clicke en la solapa "Registro" y complet tus datos.\r\n', 10),
(11, 'Se puede cambiar la contrasea?', 'No se puede. Siempre que olvides la contrasea te llegar un correo con la contrasea que tenes.', 11);
