(3, 'Valoramos que hayas generado este dilogo a travs de nuestro canal de atencin. Nos es muy importante brindarte el mejor asesoramiento frente al inconveniente por el que nos contactaste.  Gracias por toda la informacin y fotos. Nos vamos a volver a comunicar con la respuesta del anlisis en un plazo entre 24 - 72 horas hbiles. Vamos a compartirte el informe de nuestro departamento de Calidad para que puedas enviarlo a tu cliente para su tranquilidad. Por favor, ofrecer la reposicin de la mercadera afectada. Luego, vas a poder contactar a tu vendedor/a Mecas para recibir nuestra reposicin de la misma.', 'Punto de Venta');
